import React from 'react';
import './App.css';
import {Technologies} from "./Technologies";
import {Header} from "./Header";
import {Footer} from "./Footer";

function App() {
    return (
        <div className="app-wrapper">

            <header className={'header'}>
                <img className={'header-img'} src='https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/LEGO_logo.svg/512px-LEGO_logo.svg.png' alt={'logo'}/>
            </header>
            <nav className={'nav'}>
                    <div>
                        <a>Profile</a>
                    </div>
                    <div>
                        <a>Messages</a>
                    </div>
                    <div>
                        <a>News</a>
                    </div>
                    <div>
                        <a>Music</a>
                    </div>
            </nav>

            <div className={'content'}></div>

            <Footer/>

        </div>
    );
}


export default App;
